import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHome } from '@fortawesome/free-solid-svg-icons'

function Menu() {
    return (
        <div className="menu">
         <button className="btn"><FontAwesomeIcon style={{fontSize:"20px"}} icon={faHome} /></button>
        </div>
    )
}

export default Menu
